import { FaEdit, FaSearch, FaTrash, FaEyeSlash, FaEye } from "react-icons/fa"
import React, { Component } from "react";
import { Link } from "react-router-dom";
import FilmService from "../Services/FilmService"
import { Container, Carousel, CarouselItem } from "react-bootstrap";

export default class FilmsList extends Component {
    constructor(props) {
        super(props);
        this.retrieveFilms = this.retrieveFilms.bind(this);
        this.refreshList = this.refreshList.bind(this);
        this.setActiveFilm = this.setActiveFilm.bind(this);

        this.state = {
            Films: [],
            currentFilm: null,
            currentIndex: -1,
            searchTitle: "",
            idFilm: "",
        };
    }

    componentDidMount() {
        this.retrieveFilms();
    }

    retrieveFilms() {
        FilmService.retrieveAll()
            .then(response => {
                const data = response.data;
                this.setState({
                    Films: data,
                });
            })
            .catch(error => {
                console.error(error);
            });
    }

    onSubmit = async (e) => {
        e.preventDefault();
        await FilmService.searchByTitle(this.state.searchTitle)
            .then(response => {
                const data = response.data;
                this.setState({
                    Films: data,
                });
            })
            .catch(error => {
                console.error(error);
            })
    }

    setActiveFilm(Film, index) {
        this.setState({
            currentFilm: Film,
            currentIndex: index,
        });
    }

    refreshList() {
        this.retrieveFilms();
        this.setState({
            currentFilm: null,
            currentIndex: -1,
        });
    }

    deleteFilm(id) {
        console.log(id, "invoke id");
        FilmService.delete(id)

            .then(response => {
                this.refreshList()
            })
            .catch((error) => {
                alert("error")
            })
    }

    render() {
        const { Films, currentFilm, currentIndex } = this.state;

        return (
            <Container>
                <Carousel>
                    <CarouselItem>
                        <img
                            className="d-block w-100 size-image img-thumbnail"
                            src="data:image/jpeg;base64,"
                            alt="img1"
                        />
                    </CarouselItem>
                    <CarouselItem>

                        <img
                            className="d-block w-100 size-image img-thumbnail"
                            src="data:image/jpeg;base64,"
                            alt="img2"
                        />
                    </CarouselItem>
                    <CarouselItem>
                        <img
                            className="d-block w-100 size-image img-thumbnail"
                            src="data:image/jpeg;base64,"
                            alt="img3"
                        />
                    </CarouselItem>
                    <CarouselItem>
                        <img
                            className="d-block w-100 size-image img-thumbnail"
                            src="data:image/jpeg;base64," alt="img4"
                        />
                    </CarouselItem>
                </Carousel>

                <div >
                    <div className="justify-content-center align-items-center flex-md-column">
                        <div className="d-flex flex-md-column align-items-center ">
                            <h3>
                                <big class="text-muted">Cilvies</big>
                                <small class="text-muted"> List</small>
                            </h3>
                        </div>
                        <form
                            onSubmit={this.onSubmit}
                            className="mb-2 input-group d-flex justify-content-center mt-3">
                            <div className="border border-primary form-outline">
                                <input
                                    type="search"
                                    placeholder="Search film here"
                                    className="form-control"
                                    value={this.state.searchTitle}
                                    onChange={(e) => this.setState({ searchTitle: e.target.value })}
                                />
                            </div>
                            <button className="btn btn-primary">
                                <FaSearch />
                            </button>
                        </form>
                    </div>
                    <div className="d-flex w-100 justify-content-between" >
                        <ul className="list-group-item">
                            {Films &&
                                Films.map((Film, index) => (
                                    <li className={"border border-warning list-group-item list-group-item-info" + (index === currentIndex ? "" : "active")} onClick={() => this.setActiveFilm(Film, index)} key={index}>
                                        <div className=" d-flex justify-content-between">
                                            {Film.title}
                                            <div>
                                                <button className="status"> {Film.status === 0 ? <FaEyeSlash /> : <FaEye />}</button>
                                                <Link to={"/films/" + Film.id}> <FaEdit className="link-hover" /> </Link>
                                                <FaTrash onClick={() => { if (window.confirm("Are you sure delete this item?")) { this.deleteFilm(Film.id) } }} className="link-hover" />
                                            </div>
                                        </div>
                                    </li>
                                ))}
                        </ul>

                        <div className="col-md-6">
                            {currentFilm ? (
                                <div>
                                    <h4>Film Detail</h4>
                                    <div>
                                        <img className="size-image img-thumbnail" src={currentFilm.imageUrl} alt="Cover Film" />
                                    </div>
                                    <div>
                                        <label>
                                            <strong>Title:</strong>
                                        </label>{" "}
                                        {currentFilm.title}
                                    </div>
                                    <div>
                                        <label>
                                            <strong>Description:</strong>
                                        </label>{" "}
                                        {currentFilm.description}
                                    </div>


                                    <Link to={"/films/" + currentFilm.id} className="badge badge-warning">
                                        Edit
              </Link>
                                </div>
                            ) : (
                                    <div>
                                        <br />
                                        <h4>Please click on a Film
                                        <small> to See the Detail ...</small></h4>
                                    </div>
                                )}
                        </div>
                    </div>
                </div>
            </Container>
        );
    }
}

